import React from "react";

function Header(props) {
  return (
    <div className="header">
      <h1>To Do list</h1>
      <h1>{props.Title}</h1>
      <button onClick={props.toggleCreateArea} className="add-button">
        Add
      </button>
      <button
        style={{
          top: "70px",
        }}
        className="add-button"
      >
        Log out
      </button>
    </div>
  );
}

export default Header;
